        /// <summary>
        ///     Generates a random first name.
        /// </summary>
        /// <param name="gender">The gender.</param>
        /// <returns>
        ///     The first name generated.
        /// </returns>
        /// <exception cref="ArgumentOutOfRangeException">
        ///     Gender type not supported.
        /// </exception>
        public static string RandomFirstName(Gender gender)
        {
            string name;
            switch (gender)
            {
                case Gender.Any:
                    int randomGender = RandomValues.Next(1, 3);
                    name = randomGender == 1
                        ? MaleFirstNames[RandomValues.Next(0, MaleFirstNames.Length)]
                        : FemaleFirstNames[RandomValues.Next(0, FemaleFirstNames.Length)];
                    break;
                case Gender.Male:
                    name = MaleFirstNames[RandomValues.Next(MaleFirstNames.Length)];
                    break;
                case Gender.Female:
                    name = FemaleFirstNames[RandomValues.Next(FemaleFirstNames.Length)];
                    break;
                default:
                    throw new ArgumentOutOfRangeException("gender");
            }

            return name;
        }

