        /// <summary>
        ///     Returns a random value from the source enum.
        /// </summary>
        /// <param name="excludes">Items to exclude from the random selection.</param>
        /// <typeparam name="TSourceEnum">The source enum.</typeparam>
        /// <returns>
        ///     A randomly selected value from the source enum.
        /// </returns>
        public static TSourceEnum RandomEnumValue<TSourceEnum>(params TSourceEnum[] excludes)
        {
            return Enum.GetValues(typeof (TSourceEnum)).Cast<TSourceEnum>().Except(excludes).OrderBy(x => RandomValues.Next()).FirstOrDefault();
        }

        /// <summary>
        ///     Generates a random email for a person.
        /// </summary>
        /// <param name="gender">The gender.</param>
        /// <returns>
        ///     The email generated.
        /// </returns>
        public static string RandomPersonEmail(Gender gender)
        {
            string firstName = RandomFirstName(gender).ToLower();
            string lastName = RandomLastName().ToLower();
            string organization = RandomOrganizationName();
            string email = string.Format("{0}{1}@{2}.com", firstName, lastName, organization.Replace(" ", string.Empty).ToLower());
            return email;
        }

