        {
            string first = OrganizationAreas[RandomValues.Next(0, OrganizationAreas.Length - 1)];
            string organization = RandomOrganizationName();
            string email = string.Format("{0}@{1}.com", first, organization.Replace(" ", string.Empty).ToLower());
            return email;
        }

